$(function(){var $modalLang=$('#modal-lang');var $langBtn=$('#lang_btn');$langBtn.html($(".lang_selector[data-value="+(Parameters.getItem('lang')||Storage.getItem('lang')||navigator.language.substr(0,2))+"]").html());var closeMenu=function(){$modalLang.removeClass('active');setTimeout(function(){$modalLang.css('display','none');},500);}
var openMenu=function(){$modalLang.css('display','block');setTimeout(function(){$modalLang.addClass('active');},100);}
$(".lang_selector").click(function(event){var lang=$(this).attr('data-value');var $element=$(this).html();Translations.init(lang);event.preventDefault();event.stopPropagation();closeMenu();$langBtn.html($element);});$('html').on('click',function(e){var $target=$(e.target);if(!($target.is($modalLang))&&!($target.is('#lang_btn'))&&$modalLang.hasClass('active')){closeMenu();}});$('#lang_btn').click(function(){openMenu();});});